import Books from './pages/Books'
import Library from './pages/Library'
import './App.css';
import { Switch, Route } from 'react-router-dom'



function App() {
  return (
    <Switch>
     <Route exact path="/" component={Books} />
     <Route path="/library" component={Library} />
    </Switch>
  );
}

export default App;
